window.bookSummaryJSON = "<p>In the remote, rugged corner of Montana’s Glacier National Park known as the Devil’s Grasp, little Paige Baker of San Francisco disappears with her dog, Kobee, while on a camping trip with her family; or so her mother and father have told authorities. A multiagency task force launches a massive search as Paige fights to survive in the wilderness. Time hammers against her, and soon the nation is gripped by the life-and-death drama. Secretly, behind the scenes, the FBI grows suspicious of Paige’s parents. Their recent history and disturbing evidence links them to a horrible secret from the past. </p>"; 
